import React, { Component } from 'react';
import './About.css';

class Contact extends Component {
  render() {
    return(
      <div class="contact pt-4">
        <div class="row">
          <div class="col-2">&nbsp;</div>
          <div class="col-8">
            <p>Illustrator. Occasional photographer.  <br/><br/>
              Born in Yugoslavia. Raised in Croatia. Based in Rijeka. Lived in Zagreb and Berlin.  <br/><br/>
              Proud owner of a canine trash can named Frida.<br/><br/> 
              <strong>Opened for commisions!</strong>
            </p>
          </div>
        </div>
      </div>
    );
  }
}

export default Contact;
